// src/CustomDatePicker.js

import React, { useState } from 'react';
import { addDays, format, startOfWeek } from 'date-fns';

const CustomDatePicker = ({ selectedDate, onDateChange }) => {
  const [currentDate, setCurrentDate] = useState(new Date());

  const startOfWeekDate = startOfWeek(currentDate, { weekStartsOn: 0 });
  const days = Array.from({ length: 7 }, (_, i) =>
    addDays(startOfWeekDate, i)
  );

  return (
    <div className="custom-date-picker">
      {days.map(day => (
        <button
          key={format(day, 'yyyy-MM-dd')}
          className={`date-button ${format(day, 'yyyy-MM-dd') === selectedDate ? 'selected' : ''}`}
          onClick={() => onDateChange(format(day, 'yyyy-MM-dd'))}
        >
          {format(day, 'dd MMM')}
        </button>
      ))}
    </div>
  );
};

export default CustomDatePicker;
